(match if update_index = i
      then
        let new_i =
          let r = Random.State.float random_state 1.0 in
          (i + (int_of_float ((log r) /. (log (1. -. w))))) + 1 in
        let random_index = Random.State.int random_state k in
        match reservoir.(random_index) <- input with
        | () ->
            let new_w =
              let r = Random.State.float random_state 1.0 in
              w *. (exp ((log r) /. (float_of_int k))) in
            {
              update_index = (update_index + 1);
              state = { w = new_w; i = new_i };
              desired_size = k;
              reservoir
            }
      else
        {
          update_index = (update_index + 1);
          state = { w; i };
          desired_size = k;
          reservoir
        }
with
| { reservoir; desired_size; state; update_index } -> _)

(match {
        update_index = (update_index + 1);
        state = { w; i };
        desired_size = k;
        reservoir
      }
with
| { reservoir; desired_size; state; update_index } -> _)
